import React from 'react'
import { Container, Navbar } from 'react-bootstrap'

const AdminDashboard = () => {
    return (
        <Container fluid>
            <Navbar  className='wrapper d-flex align-items-stretch'></Navbar>
        </Container>
    )
}

export default AdminDashboard
